import React, {Fragment} from 'react';

const QuoteDetail = () => {
    const params = useParams();
    return (
        <Fragment>
           <h1> Quote Details page</h1>
            <p>{params.qupteId}</p>
        </Fragment>
    );
};

export default QuoteDetail;
